        bws.SetValue((0, 0.5))
        test.gui_loop()

        self.assertAlmostEqual(bws.pixel_value, (0, bws.GetSize()[0] / 2.0))
        self.assertEqual(bws.GetValue(), (0, 0.5))

        self.app.test_frame.SetSize((500, 400))

